import React, { Fragment} from 'react';

const BookListItem = ({ book }) => {

    const { title, author } = book;

    return(
        <div className="book-list-item" >
            <div className="book-cover"></div>
            <div className="book-details">  
                <span>{title}, </span>
                <span>{author}</span>
            </div>
          
        </div>
    );
}

export default BookListItem;
